(lib.UI = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});
	this.isSingleFrame = false;
	// timeline functions:
	this.frame_0 = function() {
		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		//Menu button -----------------------------------------
		//this.btn_menu.addEventListener("click", openMenu.bind(this));
		//audio buttons -----------------------------------------
		this.vol_dwn.addEventListener("click", volDwn.bind(this));
		this.vol_up.addEventListener("click", volUp.bind(this));
		this.vol_mute.addEventListener("click", voMute.bind(this));
		this.btn_musOn.addEventListener("click", musMute.bind(this));
		this.btn_musOff.addEventListener("click", musMute.bind(this));
		//Nav buttons -----------------------------------------
		this.btn_goNext.addEventListener("click", openNext.bind(this));
		this.btn_goBack.addEventListener("click", openPrev.bind(this));
		//background music ---------------------------------------
		var bgm = createjs.Sound.play('bgmAdj',{loop:-1});
		//var vo = createjs.Sound.play('VO');
		//volume vars -----------------------------------------
		var mus_mute = false;
		var vo_mute = false;
		bgm.volume = 0.2;
		var prev_vol = bgm.volume;
		//Menu function -----------------------------------------
		/*
		function openMenu(){
		 window.open ("../menu/main_menu.html","_self");
		}
		*/
		//audio functions -----------------------------------------
		function volDwn()
		{	
			if(!vo_mute){
				createjs.Sound.volume = createjs.Sound.volume -0.05;
			}
			if(!mus_mute){
				bgm.volume -= 0.05;
				prev_vol = bgm.volume;
			}
			console.log(bgm.volume);
			console.log(prev_vol);
		}
		function volUp()
		{
			if(!vo_mute){
				createjs.Sound.volume = createjs.Sound.volume +0.05;
			}
			if(!mus_mute){
				bgm.volume += 0.05;
				prev_vol = bgm.volume;
			}
			console.log(bgm.volume);
			console.log(prev_vol);
		}
		function musMute()
		{
			if(!mus_mute){
				mus_mute = true
				bgm.volume = 0;
				this.btn_musOn.visible = false;
				this.btn_musOff.visible = true;
			}
			else{
				mus_mute = false;
				bgm.volume = prev_vol;
				this.btn_musOn.visible = true;
				this.btn_musOff.visible = false;
			}
			console.log(mus_mute);
		}
		function voMute()
		{
			if(!vo_mute){
				vo_mute = true
				createjs.Sound.muted = true;
			}
			else{
				vo_mute = false;
				createjs.Sound.muted = false;
			}
			console.log(vo_mute);
		}
		//Nav functions -----------------------------------------
		function openNext(){
		 window.open ("adjective_Scene11.html","_self");
		}
		function openPrev(){
		 window.open ("adjective_Scene9.html","_self");
		}
	}
	// actions tween:
